import React from 'react'
const  FullName =''

function Item(props) {
    if (FullName==='') {
        FullName = 'hhhhh';
    }
    return(<div className='item'>
        <img  className='card-group'src='https://picsum.photos/30' alt=''/>
        <h2> {props.FullName}</h2>
        <p> {props.Professional}</p>
        <p> {props.Numberphone}</p>
        <p> {props.Email}</p>
        <p> {props.Website}</p>
        </div>
        );

}

export default Item ;
